import React from 'react';

export default function Doctor( { id, name, email, adress, phone, speciality, registration_number } ) {

  return (
    <div className='doctor'>
       <h2>{id}</h2>
      <h2>{name}</h2>
      <h3>{adress}</h3>
      <h3>{speciality}</h3>
      <h3>{registration_number}</h3>
      <h3>{phone}</h3>
      <h3>{email}</h3>

    </div>
  );
}
